import React, { Component } from 'react'
import Terminal from 'react-console-emulator'
import './App.css'

const commands = {
  echo: {
    description: 'Echo a passed string.',
    usage: 'echo <string>',
    fn: (...args) => args.join(' ')
  }
}

export default class MyTerminal extends Component {
  render() {
    return (
      <div className='container'>
        <h1>FreezingKas</h1>
        <Terminal
          className="terminal"
          commands={commands}
          welcomeMessage={'Welcome to FreezingKas terminal!'}
          promptLabel={'max@freezingkas:~$'}
        />
      </div>

    )
  }
}
